import{_ as e,o as t,c as a,R as o}from"./chunks/framework.E9w9IFh5.js";const E=JSON.parse('{"title":"组织管理转配置","description":"","frontmatter":{"title":"组织管理转配置","date":"2020-05-11T14:01:24.000Z"},"headers":[],"relativePath":"doc/wpdoc/组织管理转配置.md","filePath":"doc/wpdoc/组织管理转配置.md"}'),i={name:"doc/wpdoc/组织管理转配置.md"},l=o('<h1 id="组织管理页面改造成可配置化表单" tabindex="-1">组织管理页面改造成可配置化表单 <a class="header-anchor" href="#组织管理页面改造成可配置化表单" aria-label="Permalink to &quot;组织管理页面改造成可配置化表单&quot;">​</a></h1><p>之前的组织管理页面是用二开页面实现，实施人员不可修改，现已新增一个可配置表单页面，支持实施修改。</p><p>注意事项：该功能默认不开启，如果需要可按以下步骤操作</p><ol><li>确认web端引擎已升级到至少V9.0.0版本(登录页面底部可看到当前引擎版本号)</li><li>确认要修改的项目是基于V8.5.1-base产品版本开出的项目(在IDE右上角，头像左边，可看到项目名称和产品版本号)</li><li>确认业务领域中必须存在以下6个接口(已统一在V8.5.1-base种子库部署，一般不需要多余操作，只需确认接口存在)： <ul><li>组织查询(共用)</li><li>获取子组织列表</li><li>获取组织信息_组织编码查询</li><li>获取组织类型列表</li><li>组织排序</li><li>职位查询</li></ul></li></ol><p>把原二开表单替换成新的可配置表单，方式如下：找到新旧两个表单的协议(原表单名称：组织管理plus，新表单名称：组织管理-可配置)，把两者协议copy出来，然后把新表单协议pageinfo里面的code title pagedescr directorytypecode替换成旧表单的，再把整理好的协议，覆盖原表单。</p><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/%E7%BB%84%E7%BB%87%E7%AE%A1%E7%90%86%E8%BD%AC%E9%85%8D%E7%BD%AE.png%20" alt=""></p>',6),c=[l];function _(p,s,d,r,n,h){return t(),a("div",null,c)}const u=e(i,[["render",_]]);export{E as __pageData,u as default};
